// --- TASKS SYNC SCRIPT (LATEST) ---

function doPost(e) {
  var output = { status: 'error', message: 'Unknown error' };
  
  try {
    var requestData = {};
    if (e.postData && e.postData.contents) {
      requestData = JSON.parse(e.postData.contents);
    } else if (e.parameter && e.parameter.data) {
      requestData = JSON.parse(e.parameter.data);
    } else {
      throw new Error("No data received");
    }

    var action = requestData.action;

    switch (action) {
      case 'get_lists': 
        output = { status: 'success', data: getTaskLists() };
        break;
      case 'create_list':
        output = { status: 'success', data: createTaskList(requestData.title) };
        break;
      case 'update_list':
        output = { status: 'success', data: updateTaskList(requestData.listId, requestData.title) };
        break;
      case 'delete_list':
        output = { status: 'success', data: deleteTaskList(requestData.listId) };
        break;
      case 'get_tasks':
        output = { status: 'success', data: getTasks(requestData.listId) };
        break;
      case 'create_task':
        // IMPORTANT: 'due' parameter must be handled here
        output = { status: 'success', data: createTask(requestData.listId, requestData.title, requestData.notes, requestData.due) };
        break;
      case 'update_task':
        // IMPORTANT: 'due' parameter must be handled here
        output = { status: 'success', data: updateTask(requestData.listId, requestData.taskId, requestData.status, requestData.title, requestData.notes, requestData.due) };
        break;
      case 'delete_task':
        output = { status: 'success', data: deleteTask(requestData.listId, requestData.taskId) };
        break;
      default:
        output = { status: 'error', message: 'Invalid Action: ' + action };
    }

  } catch (error) {
    output = { status: 'error', message: error.toString() };
  }

  return ContentService.createTextOutput(JSON.stringify(output)).setMimeType(ContentService.MimeType.JSON);
}

function getTaskLists() {
  var lists = Tasks.Tasklists.list().items;
  if (!lists) return [];
  return lists.map(function(l) { return { id: l.id, title: l.title }; });
}

function createTaskList(title) {
  var resource = { title: title };
  var list = Tasks.Tasklists.insert(resource);
  return { id: list.id, title: list.title };
}

function updateTaskList(listId, title) {
  var list = Tasks.Tasklists.get(listId);
  list.title = title;
  var updated = Tasks.Tasklists.update(list, listId);
  return { id: updated.id, title: updated.title };
}

function deleteTaskList(listId) {
  try { Tasks.Tasklists.remove(listId); return true; } catch(e) { throw new Error("Cannot delete system list"); }
}

function getTasks(listId) {
  // ensure showCompleted and showHidden are true so we don't miss anything
  var tasks = Tasks.Tasks.list(listId, { showCompleted: true, showHidden: true }).items;
  if (!tasks) return [];
  return tasks.map(function(t) {
    return { id: t.id, title: t.title, status: t.status, updated: t.updated, notes: t.notes, due: t.due };
  });
}

function createTask(listId, title, notes, due) {
  var resource = { title: title, notes: notes, due: due };
  var task = Tasks.Tasks.insert(resource, listId);
  return { id: task.id, title: task.title, status: task.status };
}

function updateTask(listId, taskId, status, title, notes, due) {
  var task = Tasks.Tasks.get(listId, taskId);
  if (status) task.status = status;
  if (title) task.title = title;
  if (notes !== undefined) task.notes = notes;
  if (due !== undefined) task.due = due;
  var updated = Tasks.Tasks.update(task, listId, taskId);
  return { id: updated.id, title: updated.title, status: updated.status };
}

function deleteTask(listId, taskId) {
  Tasks.Tasks.remove(listId, taskId);
  return true;
}
